local function MuliPrint(ASCII)
    local data = {}
    data.len = #ASCII

    if data.len >= 1024 then
        local chunkSize = 1024
        local numChunks = math.ceil(data.len / chunkSize)

        for i = 1, numChunks do
            local startPos = (i - 1) * chunkSize + 1
            local endPos = math.min(i * chunkSize, data.len)
            local chunk = string.sub(ASCII, startPos, endPos)

            -- print("Chunk " .. i .. ":")
            if i == numChunks then
                chunk = chunk .. "\n" 
            end

            MsgC(color_white, chunk)
            
        end
    else
        ASCII = ASCII .. "\n"
        Msg(ASCII)
    end
end

timer.Simple(0, function()MuliPrint(table.Random(logos.original))end)